window.bookSummaryJSON = "<p><b>An ancient evil emerges. The Glass Kingdom is at war. Not even the gods can help now.</b></p> <p>Full-scale rebellion rages in the south, and Sir Torsten Unger must lead the Glass Army to face it. But when a new and unfamiliar king forces Torsten to march alongside one of his fiercest rivals, he must draw on his faith to keep the army from fracturing.&nbsp;&nbsp;</p> <p>Whitney Fierstown continues his tutelage of the blood mage, Sora, who is desperate to get a better handle on her mysterious powers. Their journey brings them to the merchant city of Winde Port, where they seek passage to Yaolin City aboard a ship. It's smooth sailing until they realize an old nemesis is hunting them, hell-bent on vengeance and willing to turn to an evil unlike any they've ever faced before.&nbsp;</p> <p><b><i>Winds of War</i></b><b> is the epic second installment in the Buried Goddess Saga, perfect for fans of R. A. Salvatore, Brandon Sanderson, and Nicholas Eames.</b>&nbsp;</p>"; 
